import ExpenseItem from "./components/ExpenseItem";
function App() {
  const expenses=[
    {title:'Car Insurance',
    amount: 393.34,
    date: new Date(2022,3,11)},
    {title:'B',
    amount: 3.24,
    date: new Date(2022,4,21)},
    {title:'C',
    amount: 93.4,
    date: new Date(2022,5,20)},
    {title:'D',
    amount: 66.89,
    date: new Date(2022,7,30)}
  ];
  return (

    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title}></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
